import React from 'react';
import Profile from "./profile";
import {connect} from "react-redux";
import {setProfile} from "../../../redux/content-reducer";
import {userAPI} from "../../../API/api";
import {withRouter} from "react-router-dom";

 class ProfileContainer extends React.Component{
     componentDidMount() {
          let userId =this.props.match.params.userId;
         userAPI.getProfileData(userId).then(response => {
             this.props.setProfile(response.data);
         });
     }
     render() {
         return <Profile
             {...this.props}
             profile={this.props.profile}/>
     }
 }
let mapStateToProps =(state)=>({
    profile:state.ProfilePage.profile
});
 let withRouterProfile = withRouter(ProfileContainer);
 export default connect(mapStateToProps,{setProfile})(withRouterProfile);
